import { useState } from "react";
import "./App.css";


const BotHand = (numberOfCards = 5) => {
  let cards = [];
  for (let i = 0; i < numberOfCards; i++) {
    cards.push("Apple");
  }
  return cards.map((card) => <div className="BotHand">{card}</div>);
};

const CenterInfo = () => {
  return (
    <div className="CenterBoard">
      <div className="turn">
        <img id="turnIcon" src="./images/bot_turn.png" alt="bot icon" />
      </div>
      <img id="deckIcon" src="./images/back.png" alt="Deck Icon" />
    </div>
  );
};

const PlayerHand = () => {
  return (
    <div className="PlayerHand">
      <img src="./images/Ace_of_Diamonds.jpg" alt="Ace of Diamonds" />
      <img src="./images/Two_of_Diamonds.jpg" alt="Two of Diamonds" />
      <img src="./images/Ace_of_Diamonds.jpg" alt="Ace of Diamonds" />
      <img src="./images/Two_of_Diamonds.jpg" alt="Two of Diamonds" />
      <img src="./images/Ace_of_Diamonds.jpg" alt="Ace of Diamonds" />
    </div>
  );
};

const GameBoard = () => {
  return (
    <div className="GameBoard">
      <BotHand />
      <CenterInfo />
      <PlayerHand />
    </div>
  );
};

const App = () => {
  return (
    <>
      <Title />
      <GameBoard />
    </>
  );
};

export default App;
